import styled from "styled-components";

export const GroupState = styled.span`
  display: flex;
  align-self: flex-start;
  justify-content: center;
  align-items: center;
  width: 40px;
  height: 22px;
  background-color: ${WARNING};
  border-radius: 5px;
  color: ${WHITE};
  font-weight: 500;
`;
